import './App.css';

function Header() {
  return(
    <div class="navbar bg-base-100">
      <div class="navbar-start">
        <h2>My Poca Wishlist Maker</h2>
      </div>
      <div class="navbar-end flex-none">
        <ul class="menu menu-horizontal px-1"> 
          <li><a class="btn">Items</a></li>
          <li><a class="btn">Wishlists</a></li>
        </ul>
      </div>
    </div>
  ) 
}

function App() {
  return(
    <div>
      <Header />
    </div>
  )
 
}

export default App;
